import { createIcon } from "../icon/createIcon";

export const ArrowLeftIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ArrowLeftIcon">
    <path d="M12 7H4v3L0 6l4-4v3h8v2z" />
  </svg>,
  "ArrowLeft",
  "arrow left"
);
